// Clean up
inline void ReadBDTG::Clear() 
{
   for (unsigned int itree=0; itree<fForest.size(); itree++) { 
      delete fForest[itree]; 
   }
}
   inline double ReadBDTG::GetMvaValue( const std::vector<double>& inputValues ) const
   {
      // classifier response value
      double retval = 0;

      // classifier response, sanity check first
      if (!IsStatusClean()) {
         std::cout << "Problem in class \"" << fClassName << "\": cannot return classifier response"
                   << " because status is dirty" << std::endl;
         retval = 0;
      }
      else {
         if (IsNormalised()) {
            // normalise variables
            std::vector<double> iV;
            iV.reserve(inputValues.size());
            int ivar = 0;
            for (std::vector<double>::const_iterator varIt = inputValues.begin();
                 varIt != inputValues.end(); varIt++, ivar++) {
               iV.push_back(NormVariable( *varIt, fVmin[ivar], fVmax[ivar] ));
            }
            retval = GetMvaValue__( iV );
         }
         else {
            retval = GetMvaValue__( inputValues );
         }
      }

      return retval;
   }

std::vector<double> ParBinner3lAInput;
ReadBDTG ParBinner3lAEvaluator;
inline double ParBinner3lAScore(double met_pt, double mTL_3l, double mllL_3l, double GenSusyMScan1, double GenSusyMScan2){
  ParBinner3lAInput.clear();
  ParBinner3lAInput.push_back(met_pt);
  ParBinner3lAInput.push_back(mTL_3l);
  ParBinner3lAInput.push_back(mllL_3l);
  ParBinner3lAInput.push_back(GenSusyMScan1);
  ParBinner3lAInput.push_back(GenSusyMScan2);
  return ParBinner3lAEvaluator.GetMvaValue(ParBinner3lAInput);
}

int newScore200100(float met_pt, float mTL_3l, float mllL_3l) {

    float score = ParBinner3lAScore(met_pt,mTL_3l,mllL_3l,200,100);
    if(score < -0.35) return 1;
	return int((score+0.35)/0.05)+2;
}





